import React from "react";
import './navbar1.css'; // Assuming the CSS file is in the same directory

const Navbar = () => {
  return (
    <div className="Navbar">
      <div className="Icon">
        <img alt="logo" src={cart} />
        <h2>E-cart</h2>
      </div>
      <div className="Menu">
        <ul>
          <li>Men <hr className="menu-line" /></li> <li>Women</li>
          <li>Kids</li>
          <li>New</li>
        </ul>
      </div>
      <button>Login</button>
    </div>
  );
};

export default Navbar;
